// Copycat tối giản engine's syllable_data_struct.zig và syllable_parsers.zig
// Không phân tích âm vị học mà lưu mapping 2 chiều giữa utf-8 và syllable_id

const std = @import("std");
const util = @import("util.zig");

pub const MAXX_ID: util.Token = 25 * 25 * 42; // = 26_250

// Chỉ cần `u15` là đủ lưu syllable_ids và vẫn dữ chỗ cho OOV vì:
// Với valid syllable_id từ 0 -> 26_249, kiểm tra thấy
// 7_722 slot không thỏa mãn luật kết hợp âm tiết. (18_528 valid syllable ids)
// Dư 6_518 slots có id từ 26_250 đến 32_767
// => Total: 14_240 free slot để lưu sub-word OOV

// Để lưu trữ hiệu quả ta dùng `u16` để làm tròn thành 2-bytes.
// Nên còn rất nhiều chỗ để tổ chức dữ liệu, bao gồm cả từ điển. Ví dụ:
// - Từ 0 đến 26_249 lưu `17_880` valid syllable_ids và `8_370` sub-word OOV_ids
// - Từ 26_250 đến 65_535 lưu `39_286` word_ids chọn lọc từ dictionary
// (Làm tròn cho dễ nhớ => `18k` syllables, `8k` oov, `40k` words)
//
// Khéo ở chỗ, chỉ cần kiểm tra token_id >= MAXX_ID thì là word
// Còn nếu token_id < MAXX_ID thì dùng ids2strs để map tới lính canh là
// len đã được mã hóa của token đó và xét giá trị của lính canh:
// - Nếu lính canh >= 'A' thì đó là syllable_id hợp lệ
// - Nếu lính canh  < 'A' thì đó là syllable_id không hợp lệ tức OOV_id
// => (( Total 140k để lưu utf-8 + lính canh của syllables ))
//
// Vì OOV được lưu dưới dạng sub-word nên mọi từ đều được biểu diễn bởi chuỗi syllable_id
// Vậy nên mỗi word_id chỉ cần map tới chuỗi syllable_id là có thể tái tạo được text
//
// Nếu 40k slots để lưu word chỉ gồm 2 âm tiết thì sẽ rất dễ để map vì:
// - 40k slots đó là liên tục
// - Mỗi word gồm 2 syllable_ids tức 4-bytes
// => (( Total 160kb là đủ lưu mapping từ 40k words 2 âm tiết tới syllable_ids ))
//
// Có thể mở rộng ra với từ 3 âm tiết, từ 4 âm tiết bằng cách phân đoạn liên tục như trên:
// - Từ 26_250 đến 60_249 lưu  `34k` words 2 âm tiết (86.5%)
// - Từ 60_250 đến 63_249 lưu   `3k` words 3 âm tiết ( 7.7%)
// - Từ 63_250 đến 65_535 lưu `2285` words 4 âm tiết ( 5.8%)
// Phân bố % gần tương tương với thống kê trong từ điển

var ids2strs: []u16 = undefined;
var strs2ids = std.StringHashMap(util.Token).init(util.allocator);

fn delta(syllable_id: util.Token) usize {
    // last syllable_id: 26250, index: 133347 / 65536
    if (syllable_id < 8750) return 0;
    if (syllable_id < 8750 * 2) return 35000;
    return 70000;
}

pub fn init() !void {
    // Khởi tạo mảng mapping ids2str
    ids2strs = try util.allocator.alloc(u16, MAXX_ID);

    var i: usize = 0;
    var syllable_id: util.Token = 0;
    while (syllable_id < MAXX_ID) : (syllable_id += 1) {
        // Ghi lại vị trí bắt đầu âm tiết của syllable_id vào mảng ids2strs
        // Có trừ đi delta() để không vượt quá u16
        ids2strs[syllable_id] = @intCast(u16, i - delta(syllable_id));

        // Gán strs2ids
        const next = i + am_tiets[i] - '@'; // tương đương `am_tiets[i] - 'A' + 1`
        // Kiểm tra tính hợp lệ của âm tiết
        if (next - i > 1) try strs2ids.put(am_tiets[i + 1 .. next], syllable_id);
        // Tới đầu âm tiết tiếp theo
        i = next;
    }
}

pub fn deinit() void {
    util.allocator.free(ids2strs);
    strs2ids.deinit();
}

const invalid_am_tiet = "~";
pub fn id2str(syllable_id: util.Token) []const u8 {
    var begin = ids2strs[syllable_id] + delta(syllable_id);
    const len = am_tiets[begin] - 'A';
    return if (len == 0) invalid_am_tiet else am_tiets[(begin + 1)..(begin + len + 1)];
}

pub fn str2id(str: []const u8) util.Token {
    if (strs2ids.contains(str)) return strs2ids.get(str).?;
    return util.NON_SYLLABLE_TOKEN;
}

pub fn isValid(syllable_id: util.Token) bool {
    if (syllable_id < MAXX_ID) {
        const guard = am_tiets[ids2strs[syllable_id] + delta(syllable_id)];
        return guard != 'A';
    }
    return false;
}

pub fn main() anyerror!void {
    try init();
    defer deinit();

    var syllable_id: util.Token = 0;
    var valid_count: usize = 0;
    var invalid_count: usize = 0;

    while (syllable_id < MAXX_ID) : (syllable_id += 1) {
        const str = id2str(syllable_id);
        if (str.len == 0) continue; // bỏ qua âm tiết không hợp lệ
        if (isValid(syllable_id)) {
            valid_count += 1;
            const id = str2id(str);
            // std.debug.print("{s} => {} == {}, ", .{ str, id, syllable_id });
            // std.debug.assert(id == syllable_id);
            if (id != syllable_id) {
                std.debug.print("{} = {}, ", .{ id, syllable_id });
            }
        } else invalid_count += 1;
    }

    std.debug.print("\n\ntotal: {}, valid: {}, invalid: {}", .{ valid_count + invalid_count, valid_count, invalid_count });
}

